parameters.tooltip:
Specify a list of entity names of the business (Doing Business As names supported here) e.g: [
        {
            "name": "abc",
            "name_type": "dba"
        }
    ]

Specify the list of addresses (places of business) e.g: [
        {
            "address_line1": "577 howard street",
            "address_line2": "suite 400",
            "city": "san francisco",
            "state": "CA",
            "postal_code": "94105",
            "full_address": "577 howard st, suite 400, san francisco CA 94105"
        }
    ] Note address_line1, city, state, postal_code are mandatory fields

